import React, { useState } from 'react';

import "./dashboard.css"

const Dashboard = () => {
    const [openSideBar, setOpenSideBar] = useState(false)

    return(
        <div className='dashboard-page'>
            <div className={`sidebar ${openSideBar && "sidebar-show"}`}>
                This is the sidebar
            </div>
            <div className='content' onClick={()=>{openSideBar && setOpenSideBar(false)}}>
                <div className='top-section'>
                    <h1>Welcome User</h1>
                    <button onClick={()=>setOpenSideBar(prevOpenSideBar=>!prevOpenSideBar)} className='top-section-navigate-button'>Navigate</button>
                </div>
                <hr></hr>
            </div>
            
        </div>
    )
}

export default Dashboard;
